import './App.css';
import { Router } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route exact path="/" component={AboutPage} />
      </Switch>
    </Router>
  );
}

export default App;
